INSERT INTO `video` VALUES (1047,1,1,1032,'纪录片','http://live.nbs.cn/channels/njtv/sepd/m3u8:500k/live.m3u8','m3u8',NULL,1,1,'大陆',2020,'自导','自演',9,'|院线|','忙的时候，想要休息；\n度假的时候，想到未来。\n穷的时候，渴望富有；\n生活安逸了，怕幸福不能长久。\n该决定的时候，担心结果不如预期；\n看明白了，后悔当初没有下定决心。\n不属于自己的，常常心存欲望；\n握在手里了，又怀念未拥有前的轻松。\n生命若不是现在，那是何时？\n\n一个人可以毫无道理跟你做一辈子亲戚,但\n一个人不会毫无道理跟你做一辈子朋友\n我会想起与你们认识的种种.\n也会想起发生过的点点滴滴.\n直到我们都年老时是否会像现在这样坐在电脑前互诉心声？\n不管如何,希望我们永远是真诚相对的朋友(知己)\n\n朋友就是喜欢你也了解你的人\n愿你都能珍惜身边每一个朋友\n因为你我有缘份，才能成为朋友\n可以成为知己的，更难得！\n时间未必是你我成为知己的原因\n但一定可以证明到\n你对朋友的关怀不是白费！\n希望您永远都系我的好朋友！\n朋友，是你高兴时想跟他分享的，\n朋友，是你不高兴时可以给你发脾气的，\n朋友，也是在你没钱开饭时打救你的，\n朋友，你闷得发慌时可以跟你一同发慌的，\n朋友，会甘愿给功课你抄，跟你一同出猫一同被人罚的，\n朋友，也是你买手信时，想买一份大的给他的，\n朋友，也是你看见他上线时！\n\n想要体会一年有多少价值，你可以去问一个失败重修的学生。\n想要体会一月有多少价值，你可以去问一个不幸早产的母亲。\n想要体会一周有多少价值，你可以去问一个定期周刊的编辑。\n想要体会一小时有多少价值，你可以去问一对等待相聚的恋人。\n想要体会一分钟有多少价值，你可以去问一个错过火车的旅人。\n想要体会一秒钟有多少价值，你可以去问一个死里逃生的幸运儿。\n想要体会一毫秒有多少价值，你可以去问一个错失金牌的运动员。\n\n朋友就是……即使是一点小感动，一点小事情都想一起分享\n朋友就是……当你抱头哭的时候，扶着你肩膀的那个人\n朋友就是……当你面对人生挫折时，一直紧握你那双手\n你好吗？\n\n你能够看到他是你与他的缘份\n你能够和你身边的人做朋友也是你与他的缘份\n纵使你不知道这颗流星会何时消失\n但如若你好好珍惜看到这流星的每一刻\n那就算流星走了你也不会后悔\n请大家好好珍惜身边的每一个人\n珍惜这段友谊！\n\n建立友谊如像种树，因为友谊是一株树\n(TREE):\nT:Trust(信任)\nR:Respect(尊重)\nE:Exchange(交流)\nE:Emotional Support(精神支持)\n\n朋友就是无形中伴你走过风雨，永远支持你的力量\n朋友就是一种无法言喻的美好感觉\n朋友就是在别人面\n前永远护著你的那个人\n朋友就是即使是一点小感动，一点小事情都想一起分享\n朋友就是当你抱头痛哭的时候，扶著你肩膀的那个人\n朋友就是当你面对人生挫折时，一直紧握你的那双手\n喜欢下雨，因为你不会知道我流泪……','admin','2020-04-13 07:55:58',12,'2020-04-13 07:55:20','00:11:24',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1045,1,1,1030,'纪录片','http://mixtvapi.mixtvapp.com:8080/rmt/0fc71333f8f349f79b4ce7125b302dcf.mp4','MixTV_mp4',NULL,1,1,'大陆',2020,'自导','自演',9,'|院线|','忙的时候，想要休息；\n度假的时候，想到未来。\n穷的时候，渴望富有；\n生活安逸了，怕幸福不能长久。\n该决定的时候，担心结果不如预期；\n看明白了，后悔当初没有下定决心。\n不属于自己的，常常心存欲望；\n握在手里了，又怀念未拥有前的轻松。\n生命若不是现在，那是何时？\n\n一个人可以毫无道理跟你做一辈子亲戚,但\n一个人不会毫无道理跟你做一辈子朋友\n我会想起与你们认识的种种.\n也会想起发生过的点点滴滴.\n直到我们都年老时是否会像现在这样坐在电脑前互诉心声？\n不管如何,希望我们永远是真诚相对的朋友(知己)\n\n朋友就是喜欢你也了解你的人\n愿你都能珍惜身边每一个朋友\n因为你我有缘份，才能成为朋友\n可以成为知己的，更难得！\n时间未必是你我成为知己的原因\n但一定可以证明到\n你对朋友的关怀不是白费！\n希望您永远都系我的好朋友！\n朋友，是你高兴时想跟他